import React from 'react';

import {
  Container,
  ContentContainer,
  TitleContainer,
  SubTitle,
  ImageContainer,
} from './styles';

import imageIIDS from 'src/assets/projects/iids.jpg';
import Thumbnail from 'src/components/thumbnail';

const Project: React.FC = () => {
  return (
    <Container>
      <ContentContainer>
        <TitleContainer>Projects</TitleContainer>
        <SubTitle>
          Aqui estão alguns dos meus trabalhos, foram realizados em torno de 182
          projetos. Separei alguns dos projetos próprios ou realizados em
          parceria nessa sessão
        </SubTitle>
        <ImageContainer>
          <Thumbnail
            image={imageIIDS}
            title="DSFDSF"
            description="sdfiushfd"
          ></Thumbnail>

          <Thumbnail
            image={imageIIDS}
            title="DSFDSF"
            description="sdfiushfd"
          ></Thumbnail>
        </ImageContainer>
      </ContentContainer>
    </Container>
  );
};

export default Project;
